import React, { Component } from 'react';
import { Nav } from 'react-bootstrap';
// import classnames from "classnames";
// import { Link } from 'react-router-dom';

import './nav.css';
import './main.css';

export default class NavBarItem extends Component {
    constructor(props) {
        super(props);

        this.state = {
            fontWeight: (this.props.id === this.props.selected) ? '500' : 'normal'
        }
    }

    // isSelected(props) {
    //     const selected = this.state.selected;
    // }

    render() {
        return (
            <Nav.Link id={this.props.id} href={this.props.href} selected={this.props.selected} style={{ fontWeight: this.state.fontWeight }}>{this.props.label}</Nav.Link>
        )
    }
}
